new Vue({
    el: '#q-app',
    data: function () {
        return {
            predictionTab: "",
            predicting: false,
            tab: "",
            selected_model: 0,
            model_objects: {},
            models: [
                {label: "Transfer learning with Mobilenetv2", name: 'mobilenetv2', summary: 'Model is currently Loading...', notebook: "notebook_mobilenetv2.ipynb"},
                {label: "Baseline CNN Model", name: 'base_cnn', summary: 'Model is currently Loading...', notebook: "notebook_cnn.ipynb"}
	    ],
            prediction: "",
            imageData:"data:image/jpeg;base64,",
            labels: {
                CBB: "This is a bacterial infection attributed by moisture. So, cassava plants in moist areas are the ones most affected. The symptoms exhibited are black leaf spots and blights. The affected leaves dry prematurely and shed-off as a result of wilting.", 
                CBSD: "Is carried by a vector called whiteflies. Its symptoms include characteristic yellow of the vein which sometimes enlarges and forms visually large yellow patching. CBSD also shows symptoms of dark-brown necrotic areas on the tuber root with a reduc- tion in root size.",
                CGM: "It causes white spots on the leaves. It starts with small spots which then enlarges to cover the whole leaf surface leading to loss of chlorophyll hence affecting photosynthesis. Severe CGM also causes mottling symptoms that can be easily confused with cas- sava mosaic, the leaves affected dry out, shrink and break away from the plant.",
                CMD: "Has many foliar symptoms of mottling, mosaic rust, twisted leaves and a general reduction in sizes of leaves as well as the affected plants. Leaves always have patches of green mixed with the different coloring of yellow and white patches. The patches reduce the surface area for photosynthesis resulting in stunted growth and low yield.",
                Healthy: "Standard green unblemished cassava leaf"
            },
            labelProbability: {
                CBB: '',
                CBSD: '',
                CGM: '',
                CMD: '',
                Healthy: ''
            },
            labelIndex: ["CBB", "CBSD", "CGM", "CMD", "Healthy"]
        }
    },
    methods: {
        onItemClick (index) {
            this.selected_model = index
            this.loadModel(index)
        },
        loadModel (index) {
            let model_name = this.models[index] ? this.models[index].name : null
            if (model_name == null) {
                return;
            } 
            this.selected_model = index
            if (!this.model_objects.hasOwnProperty(model_name)) {
                this.model_objects[model_name] = null
                this.resetPrediction()
                let self = this

                tf.loadLayersModel(`model/${model_name}/model.json`, {
                    onProgress: function (fraction) {
                        let percentage = (fraction * 100).toFixed(2) + '%'
                        self.models[index].summary = `Model is currently loading: ${percentage} loaded`
                    }
                }).then((model_data) => {
                    this.model_objects[model_name] = model_data
                    this.models[index].summary = ''
                    this.model_objects[model_name].summary(null, null, (line) => {
                        this.models[index].summary += "\n" + line
                    })
                    this.predict()
                })
            } else {
                this.predict()
            }
        },
        resetPrediction () {
            this.predictionTab = ""
            this.prediction = ""
            this.labelIndex.forEach((v) => {
                this.labelProbability[v] = ""
            })
        },
        predict () {
            if (this.imageData == '') {
                return
            }
            this.predicting = true
            this.resetPrediction();
            let model = this.model_objects[this.models[this.selected_model].name]
            let imageTensor = tf.browser.fromPixels(this.$refs.image)
            console.log("Image Size " + imageTensor.shape)
            let tensorResized = tf.image.resizeNearestNeighbor(imageTensor, [224, 224]).expandDims()
            console.log("Image resized " + tensorResized.shape)
            model.predict(tensorResized).data().then((data) => {
                let max = -1
                let labelMax = ''
                console.log(data)
                data.forEach((v, i) => {
                    let label = this.labelIndex[i]
                    if (v > max) { 
                        labelMax = label
                        max = v
                    }
                    this.labelProbability[label] = (v*100).toFixed(2) + '%'
                })
                this.predictionTab = labelMax
                this.prediction = labelMax
                this.predicting = false
            })
        },
        selectImage () {
            this.$refs.imageSelector.click();
        },
        imageSelected () {
            if (this.$refs.imageSelector.files && this.$refs.imageSelector.files[0]) {
                let reader = new FileReader()
                let self = this
                reader.onload = function (e) {
                    self.imageData = e.target.result;
                    self.predict()
                }
                reader.readAsDataURL(this.$refs.imageSelector.files[0])
            }
        },
        notebookLink (model) {
            return `model/${model.name}/${model.notebook}`
        }
    },
    mounted () {
        this.tab = this.models[this.selected_model].name
        this.loadModel(this.selected_model)
    }
})
